s handling missing values, removing outliers, normalizing or standardizing features, and encoding categorical variables, among other tasks. Ensuring that the data is clean and well-prepared is essential for building accurate and reliable classification models, as the quality of the input data directly impacts the performance and generalisation ability of the models.\n\n\n\n\n","metadata":{}},{"cell_type":"markdown","source":"* # pre-processing\n#### *** Did you undertake any prepossessing? If so, why?","metadata":{}},{"cell_type":"markdown","source":"##### The ideal data for machine learning classification has three key attributes: it is accurately labeled to provide ground truth, diverse to enable generalisation, and high quality to minimise noise and errors. Proper preprocessing and feature engineering can also improve model performance. Overall, a combination of labeled, diverse, high-quality data enables robust classifier training.\n\n##### Machine learning tasks often involve both numerical data like age and cholestrol levels which can be directly measured, and ordinal data like sex and smoking status (yes or no) that has a natural ranking. Numerical data requires preprocessing like normalisation and standardisation to scale features appropriately. Ordinal data needs encoding techniques like integer encoding or one-hot encoding to represent the hierarchical order effectively. Properly handling both data types is crucial for machine learning.\n\nG. Cerulli, ‘The Basics of Machine Learning’, in Fundamentals of Supervised Machine Learning: With Applications in Python, R, and Stata, G. Cerulli, Ed., in Statistics and Computing. , Cham: Springer International Publishing, 2023, pp. 1–17. doi: 10.1007/978-3-031-41337-7_1.","metadata":{}},{"cell_type":"code","source":"# Explore the dataset size\ncat(\"Number of rows in the dataset:\", nrow(data), \"\\n\")\ncat(\"Number of columns in the dataset:\", ncol(data), \"\\n\")\n\n# Explore the dataset\ncat(\"Summary of the dataset:\\n\")\nsummary(data)\n\n# Check for missing values\ncat(\"\\n\\nNumber of missing values per column:\\n\")\nmissing_values <- colSums(is.na(data))\nprint(missing_values)\n#removing X column as the entries have anonomysed Patient_ID a\ndata <- subset(data, select =  -c(X))\n\n# Remove rows with missing values\n#cleaned_data <- data[complete.cases(data), ]\n# Explore the dataset size\ncat(\"Number of rows in the dataset:\", nrow(data), \"\\n\")\ncat(\"Number of columns in the dataset:\", ncol(data), \"\\n\")","metadata":{"execution":{"iopub.status.busy":"2024-02-17T21:57:15.887201Z","iopub.execute_input":"2024-02-17T21:57:15.889234Z","iopub.status.idle":"2024-02-17T21:57:15.954095Z"},"trusted":true},"execution_count":175,"outputs":[{"name":"stdout","text":"Number of rows in the dataset: 920 \nNumber of columns in the dataset: 22 \nSummary of the dataset:\n","output_type":"stream"},{"output_type":"display_data","data":{"text/plain":"       X           Patient_ID        sex              age        pace_maker\n Min.   :  1.0   Min.   :  17   Min.   :0.0000   Min.   :28.00   NO:920    \n 1st Qu.:230.8   1st Qu.:2599   1st Qu.:1.0000   1st Qu.:47.00             \n Median :460.5   Median :4936   Median :1.0000   Median :54.00             \n Mean   :460.5   Mean   :4971   Mean   :0.7891   Mean   :53.51             \n 3rd Qu.:690.2   3rd Qu.:7374   3rd Qu.:1.0000   3rd Qu.:60.00             \n Max.   :920.0   Max.   :9990   Max.   :1.0000   Max.   :77.00             \n       cp          trestbps          chol            fbs          restecg      \n Min.   :1.00   Min.   :  0.0   Min.   :  0.0   Min.   :0.00   Min.   :0.0000  \n 1st Qu.:3.00   1st Qu.:120.0   1st Qu.:164.0   1st Qu.:0.00   1st Qu.:0.0000  \n Median :4.00   Median :130.0   Median :221.0   Median :0.00   Median :0.0000  \n Mean   :3.25   Mean   :123.7   Mean   :192.6   Mean   :0.15   Mean   :0.6033  \n 3rd Qu.:4.00   3rd Qu.:140.0   3rd Qu.:267.0   3rd Qu.:0.00   3rd Qu.:1.0000  \n Max.   :4.00   Max.   :2