             \n4   1                      \n5   1                      \n6   1                      \n7   1                      \n8   1                      \n9   1                      \n10  1                      \n11  1                      \n12  1                      \n13  1                      \n14  1                      \n15  1                      \n16  1                      \n17  1                      \n18  1                      \n19  1                      \n20  1                      \n21  1                      \n22  1                      \n23  1                      \n24  1                      \n25  1                      \n26  1                      \n27  1                      \n28  1                      \n29  1                      \n30  1                      \n⋮   ⋮                      \n854 0                      \n855 0                      \n856 0                      \n857 0                      \n858 0                      \n859 0                      \n860 0                      \n861 0                      \n862 0                      \n863 0                      \n864 0                      \n865 0                      \n866 0                      \n867 0                      \n868 0                      \n869 0                      \n870 0                      \n871 0                      \n872 0                      \n873 0                      \n874 0                      \n875 0                      \n876 0                      \n877 0                      \n878 0                      \n879 0                      \n880 0                      \n881 0                      \n882 0                      \n883 0                      "},"metadata":{}}]},{"cell_type":"markdown","source":"In R, factors provide a convenient way to handle categorical data by assigning integer labels to unique levels of a categorical variable. For binary categories like \"yes\" and \"no,\" factors can represent them as 1 and 0, respectively, simplifying classification tasks. However, to maintain consistency and uniformity across the dataset, it's common practice to convert categorical values to binary representations directly. For multi-category variables, one-hot encoding expands the categorical variable into multiple binary columns, each representing a unique category. This approach preserves the categorical information while ensuring compatibility with binary classification algorithms. Factors in R offer flexibility in handling categorical data efficiently, facilitating meaningful analysis and interpretation. One-hot encoding is used on prescribed drugs and thalium test (non-ordinal) results while normalisation is used for flouroscopy results which is the number of blood vessels that are dyed showing defect. For the number of blood vessels illuminated with fluoroscopy results, since the values are ordinal and represent discrete categories (0, 1, 2, 3), one-hot encoding might not be the best approach. One-hot encoding is typically used for nominal categorical variables where there is no inherent order or magnitude between the categories. Normalisation scales the numerical values to a range between 0 and 1, which can help prevent features with larger magnitudes from dominating the model training process. In this case, min-max scaling to normalise the values of the number of blood vessels to the range [0, 1]. This way, each value would retain its ordinal relationship with the others while being scaled appropriately for machine learning algorithms.","metadata":{}},{"cell_type":"code","source":"\n# Create two new columns for Aspirin and Clopidogrel\ndata$Aspirin <- ifelse(data$prescribed_drugs == \"Aspirin\" | data$prescribed_drugs == \"both\", 1, 0)\ndata$Clopidogrel <- ifelse(data$prescribed_drugs == \"Clopidogrel\" | data$prescribed_drugs == \"both\", 1, 0)\n\n# Change family history values to binary \ndata$family_history <- ifelse(data$family_history == \"yes\", 1, 0)\n\n# One-hot encoding for thalium test results to present a binary\ndata$thal_results_normal <- ifelse(data$thalium_test_result == 3, 1, 0)\ndata$thal_results_fixed_defect <- ifelse(data$thalium_test_result == 6, 1, 0)\ndata$thal_results_reversable_defect <- ifelse(data$thalium_test_result == 7, 1, 0)\n\n# normalising num_blood_vessels from 0 to 1\ndata$num_blood_vessels <- ifelse(data$num_blood_vessels == 0, 0,\n                                 ifelse(data$num_blood_vessels == 1, 0.33,\n                                        ifelse(data$num_blood_vessels == 2, 0.67,\n                                               ifelse(data$num_blood_vessels == 3, 1, NA))))\n\n# One-hot encoding for the slop of the peak excercise ST segment \ndata$upslope_exercise_ST <- ifelse(data$slope_exercise_ST == 1, 1, 0)\ndata$flat_exercise_ST <- ifelse(data$slope_exercise_ST == 2, 1, 0)\ndata$downslope_exercise_ST <- ifelse(data$slope_exercise_ST == 3, 1, 0)\n\n# One-hot encoding for resting electrocardiographic results\ndata$normal_ecg_results <- ifelse(data$resting_ecg_results == 0, 1, 0)\ndata$abnormalST_T_ecg_results <- ifelse(data$resting_ecg_results == 1, 1, 0)\ndata$left_ventricular_hypertrophy_ecg_results <- ifelse(data$resting_ecg_results == 2, 1, 0)\n\n#One-hot encoding for chest pain type\ndata$typical_angina <- ifelse(data$chest_pain_type == 1, 1, 0)\ndata$atypical_angina <- ifelse(data$chest_pain_type == 2, 1, 0)\ndata$nonanginal <- ifelse(data$chest_pain_type == 3, 1, 0)\ndata$asymptomatic <- ifelse(data$chest_pain_type == 4, 1, 0)\ndata$heart_disease_diagnosis <- ifelse(data$heart_disease_diagnosis == 1, \"Positive\", \"Negative\")\n\n# Remove the original columns that were one-hor encoded \ndata <- data[, !names(data) %in% c(\"prescribed_drugs\",\"thalium_test_result\",\"slope_exercise_ST\",\"resting_ecg_results\",\"chest_pain_type\")]\n","metadata":{"execution":{"iopub.status.busy":"2024-02-17T21:57:22.809212Z","iopub.execute_input":"2024-02-17T21:57:22.811081Z","iopub.status.idle":"2024-02-17T21:57:22.885864Z"},"tru