sure were not taken the value were set to zero which can not be accurate or correct so 0 value for these two columns should be removed","metadata":{}},{"cell_type":"code","source":"# library(\"scales\")\n\n# sapply(dataset$traponin, rescale)\n","metadata":{"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"code","source":"# normalized<-function(y) {\n\n#   x<-y[!is.na(y)]\n\n#   x<-(x - min(x)) / (max(x) - min(x))\n\n#   y[!is.na(y)]<-x\n\n#   return(y)\n#   }\n","metadata":{"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"code","source":"# dataset <- lapply(dataset[,20],normalized)\n\n","metadata":{"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"code","source":"","metadata":{},"execution_count":null,"outputs":[]},{"cell_type":"code","source":"","metadata":{},"execution_count":null,"outputs":[]},{"cell_type":"code","source":"# head(cleaned_data)","metadata":{"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"code","source":"# caret::featurePlot(x = dataset[, 2:(dim(dataset)[2]-1)], \n#                    y = dataset$class, \n#                    plot = \"ellipse\",\n                   ## Add a key at the top\n#                    auto.key = list(columns = 2))\n","metadata":{"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"When building predictive models, it's crucial to maintain the distribution of the target variable in both the training and testing datasets. By specifying the target_variable, you instruct the createDataPartition function to split the data while preserving the proportion of different classes or levels of the target variable in both the training and testing sets.","metadata":{}},{"cell_type":"code","source":"#Split data into training and testing sets\nset.seed(123)  # Set seed for reproducibility\ntrainIndex <- createDataPartition(data$heart_disease_diagnosis, p = 0.8, list = FALSE)\ntrainData <- data[trainIndex, ]\ntestData <- data[-trainIndex, ]\n\n#split the training and test data into features and labels\n# Extract labels from training data\ntrainLabels <- trainData$heart_disease_diagnosis\ntrainLabels <- as.factor(trainLabels)\n\n# Remove labels from training data\ntrainFeatures <- trainData[, -which(names(trainData) == \"heart_disease_diagnosis\")]\n\n# Extract labels from testing data\ntestLabels <- testData$heart_disease_diagnosis\ntestLabels <- as.factor(testLabels)\n# Remove labels from testing data\ntestFeatures <- testData[, -which(names(testData) == \"heart_disease_diagnosis\")]\n","metadata":{"execution":{"iopub.status.busy":"2024-02-17T22:31:45.387018Z","iopub.execute_input":"2024-02-17T22:31:45.389243Z","iopub.status.idle":"2024-02-17T22:31:45.430522Z"},"trusted":true},"execution_count":211,"outputs":[]},{"cell_type":"code","source":"# Print the lengths of datasets\ncat(\"Length of trainFeatures:\", ncol(trainFeatures), \"\\n\")\ncat(\"Length of testFeatures:\", ncol(testFeatures), \"\\n\")\ncat(\"Length of trainLabels:\", length(trainLabels), \"\\n\")\ncat(\"Length of testLabels:\", length(testLabels), \"\\n\")\n","metadata":{"execution":{"iopub.status.busy":"2024-02-17T22:30:45.873333Z","iopub.execute_input":"2024-02-17T22:30:45.875561Z","iopub.status.idle":"2024-02-17T22:30:45.907184Z"},"trusted":true},"execution_count":207,"outputs":[{"name":"stdout","text":"Length of trainFeatures: 24 \nLength of testFeatures: 24 \nLength of trainLabels: 516 \nLength of testLabels: 128 \n","output_type":"stream"}]},{"cell_type":"markdown","source":"***2. Run the classifier with default parameters.\na. How accurately can the classifier predict those that develop heart disease?\nWhat is in the output that signifies this?\nb. How many people are misclassified as developing heart disease? Where is\nthis answer found in the output?\n3. Plot and submit ROC curves for the class that develops heart disease. What is\nanother measure of accuracy commonly used?","metadata":{"execution":{"iopub.status.busy":"2024-02-17T22:36:22.568643Z","iopub.execute_input":"2024-02-17T22:36:22.570558Z","iopub.status.idle":"2024-02-17T22:36:22.587560Z"}}},{"cell_type":"markdown","source":"Random forests’ tuning parameter is the number of randomly selected predictors, k, to choose from at each split, and is commonly referred to as mtry. In the regression context, Breiman (2001) recommends setting mtry to be one-third of the number of predictors.\n\n— Page 199, Applied Predictive Modeling, 2013.\nhttps://machinelearningmastery.com/random-forest-ensemble-in-python/#:~:text=Random%20forests%E2%80%99%20tuning%20parameter%20is%20the%20number%20of,to%20be%20one-third%20of%20the%20number%20of%20predictors.\n\nhttps://www.statology.org/random-forest-in-r/","metadata":{}},{"cell_type":"code","source":"# Train the Random Forest model\nrf_model <- randomForest(trainLabels ~ ., data = trainFeatures, ntree = 500)\n\n# Make predictions on the test set\npredictions <- predict(rf_model, testFeatures)\nbin_predictions <- ifelse(predictions == \"positive\", 1, 0)\nconf_matrix <- table(testLabels, predictions)\nconf_matrix\nTP <- conf_matrix[2, 2]  # True Positives\nTN <- conf_matrix[1, 1]  # True Negatives\nFP <- conf_matrix[1, 2]  # False Positives\nFN <- conf_matrix[2, 1]  # False Negatives\n\n# Calculate sensitivity, specificity, and accuracy\nsensitivity <- TP / (TP + FN)\nspecificity <- TN / (TN + FP)\naccuracy <- (TP + TN) / sum(conf_matrix)\n\n# Print the evaluation metrics\ncat(\"Sensitivity (True Positive Rate):\", sensitivity, \"\\n\")\ncat(\"Specificity (True Negative Rate):\", specificity, \"\\n\")\ncat(\"Accuracy:\", accuracy, \"\\n\")\n","metadata":{"execution":{"iopub.status.busy":"2024-02-17T23:06:35.574114Z","iopub.execute_input":"2024-02-17T23:06:35.576137Z","iopub.status.idle":"2024-02-17T23:06:36.154447Z"},"trusted":true},"execution_count":250,"outputs":[{"output_type":"display_data","data":{"text/plain":"          predictions\ntestLabels Negative Positive\n  Negative       54       11\n  Positive       14       49"},"metadata":{}},{"name":"stdout","text":"Sensitivity (True Positive Rate): 0.7777778 \nSpecificity (True Negative Rate): 0.8307692 \nAccuracy: 0.8046875 \n","output_type":"stream"}]},{"cell_type":"markdown","source":"Accuracy is calculated by adding true positives and true negatives and deviding by the size of the dataset. 11 people are missclassified by this model as having a heart disease while labels state that infact these 11 people should have been predeicted negative","metadata":{}},{"cell_type":"code","source":"rf_model","metadata":{"execution":{"iopub.status.busy":"2024-02-17T23:06:45.928885Z","iopub.execute_input":"2024-02-17T23:06:45.931753Z","iopub.status.idle":"2024-02-17T23:06:45.953443Z"},"trusted":true},"execution_count":251,"outputs":[{"output_type":"display_data","data":{"text/plain":"\nCall:\n randomForest(formula = trainLabels ~ ., data = trainFeatures,      ntree = 500) \n               Type of random forest: classification\n                     Number of trees: 500\nNo. of variables tried at each split: 4\n\n        OOB estimate of  error rate: 18.6%\nConfusion matrix:\n         Negative Positive class.error\nNegative      224       40   0.1515152\nPositive       56      196   0.2222222"},"metadata":{}}]},{"cell_type":"code","source":"# Create a prediction object\npred <- prediction(as.numeric(predictions), as.numeric(testLabels))\n\n# Create a performance object\nperf <- performance(pred, \"tpr\", \"fpr\")\n\n# Plot the ROC curve\n# Plot the ROC curve\n\nplot(perf, colorize = TRUE, main = \"ROC Curve\", xlab = \"False Positive Rate\", ylab = \"True Positive Rate\")\n\n# Add line representing random classification\nabline(a = 0, b = 1, col = \"gray\", lty = 2)\n\n# Add legend\nlegend(\"bottomright\", \n       legend = \"Random Classification\", \n       col = \"gray\", \n       lty = 2, \n       text.font = 2,  \n       bg = \"white\",   # Background color\n       inset = 0.05,   # Adjust inset for position\n       t