U5ErkJggg=="},"metadata":{"image/png":{"width":420,"height":420}}}]},{"cell_type":"code","source":"# Fit the logistic regression model\nlogistic_model <- glm(trainLabels ~ ., data = trainFeatures, family = binomial)\n\n# Get summary of the logistic regression model\nsummary(logistic_model)\n\n# Get coefficients\ncoefficients <- coef(logistic_model)\n\n# Sort coefficients by absolute value\nsorted_coefficients <- sort(abs(coefficients), decreasing = TRUE)\n\n# Find the most important feature\nmost_important_feature <- names(sorted_coefficients)[1]\n\n# Print the most important feature\nprint(paste(\"The most important feature is:\", most_important_feature))","metadata":{"execution":{"iopub.status.busy":"2024-02-17T23:50:50.672013Z","iopub.execute_input":"2024-02-17T23:50:50.674235Z","iopub.status.idle":"2024-02-17T23:50:50.790243Z"},"trusted":true},"execution_count":292,"outputs":[{"output_type":"display_data","data":{"text/plain":"\nCall:\nglm(formula = trainLabels ~ ., family = binomial, data = trainFeatures)\n\nDeviance Residuals: \n    Min       1Q   Median       3Q      Max  \n-2.8461  -0.5283  -0.1057   0.4456   3.0381  \n\nCoefficients: (4 not defined because of singularities)\n                                         Estimate Std. Error z value Pr(>|z|)\n(Intercept)                              -1.96376    1.27552  -1.540 0.123665\nsex_male                                  1.31777    0.36094   3.651 0.000261\nage                                      -1.48795    0.88088  -1.689 0.091186\nresting_blood_pressure_mmHg               1.50718    0.90360   1.668 0.095324\nserum_cholesterol_mgdL                    1.57660    1.22453   1.288 0.197916\nfasting_blood_sugar_more_than_120_mgdL    0.27387    0.40363   0.679 0.497450\nmax_heart_rate                           -1.47261    0.84320  -1.746 0.080732\nexercise_induced_angina                   1.13829    0.31109   3.659 0.000253\nST_depression                             5.35889    1.06516   5.031 4.88e-07\nperfusi