           \nprescribed_drugsBoth                        \nprescribed_drugsClopidogrel                 \nprescribed_drugsNone                        \ntroponin_level                              \nAspirin                                     \nClopidogrel                                 \nthal_results_normal                      ***\nthal_results_reversable_defect              \nupslope_exercise_ST                         \nflat_exercise_ST                            \nnormal_ecg_results                          \nabnormalST_T_ecg_results                    \nleft_ventricular_hypertrophy_ecg_results    \ntypical_angina                           .  \nnonanginal                               ** \n---\nSignif. codes:  0 ‘***’ 0.001 ‘**’ 0.01 ‘*’ 0.05 ‘.’ 0.1 ‘ ’ 1\n\n(Dispersion parameter for binomial family taken to be 1)\n\n    Null deviance: 715.05  on 515  degrees of freedom\nResidual deviance: 368.10  on 493  degrees of freedom\nAIC: 414.1\n\nNumber of Fisher Scoring iterations: 6\n"},"metadata":{}},{"name":"stdout","text":"[1] \"The most important feature is: ST_depression\"\n","output_type":"stream"}]},{"cell_type":"code","source":"# Predict new features\npredicted_probabilities <- predict(logistic_model, newdata = testFeatures, type = \"response\")\n\n# Convert predicted probabilities to binary predictions\npredictions <- ifelse(predicted_probabilities > 0.5, 1, 0)\n\n# Create a prediction object\npred <- prediction(predicted_probabilities, testLabels)\n\n# Create a performance object\nperf <- performance(pred, \"tpr\", \"fpr\")\n\n# Plot the ROC curve\nplot(perf, main = \"ROC Curve for Logistic Regression Model\", col = \"blue\", lwd = 2)\n# Add line representing random classification\nabline(a = 0, b = 1, col = \"gray\", lty = 2)\n\n# Add legend\nlegend(\"bottomright\", \n       legend = \"Random Classification\", \n       col = \"gray\", \n       lty = 2, \n       text.font = 2,  \n       bg = \"white\",   # Background color\n       inset = 0.05,   # Adjust inset for position\n       text.width = 0.35  # Adjust the width of the legend text\n)\n# Calculate AUC\nauc <- performance(pred, \"auc\")\ncat(\"AUC:\", as.numeric(auc@y.values), \"\\n\") \n\n# Create the confusion matrix\nconf_matrix <- table(testLabels, predictions)\nprint(conf_matrix)\n\n# Calculate accuracy\naccuracy <- sum(diag(conf_matrix)) / sum(conf_matrix)\ncat(\"Accuracy:\", accuracy, \"\\n\")\n\n# Calculate sensitivity (True Positive Rate)\nsensitivity <- conf_matrix[2, 2] / sum(conf_matrix[2, ])\ncat(\"Sensitivity (True Positive Rate):\", sensitivity, \"\\n\")\n\n# Calculate specificity (True Negative Rate)\nspecificity <- conf_matrix[1, 1] / sum(conf_matrix[1, ])\ncat(\"Specificity (True Negative Rate):\", specificity, \"\\n\")","metadata":{"execution":{"iopub.status.busy":"2024-02-18T00:33:22.082218Z","iopub.execute_input":"2024-02-18T00:33:22.084805Z","iopub.status.idle":"2024-02-18T00:33:22.306634Z"},"trusted":true},"execution_count":315,"outputs":[{"name":"stderr","text":"Warning message in predict.lm(object, newdata, se.fit, scale = 1, type = if (type == :\n“prediction from a rank-deficient fit may be misleading”\n","output_type":"stream"},{"name":"stdout","text":"AUC: 0.8634921 \n          predictions\ntestLabels  0  1\n  Negative 56  9\n  Positive 16 47\nAccuracy: 0.8046875 \nSensitivity (True Positive Rate): 0.7460317 \nSpecificity (True Negative Rate): 0.8615385 \n","output_type":"stream"},{"output_type":"display_data","data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAAA0gAAANICAIAAAByhViMAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdd2CTdeLH8W9W23Tvlk5aSluggz1diAtFPc89TnGiiHvg+rn1HHeHE+fp3Sku\nTj3RYziAE1zI6i60QEvpHnSnbcbz+yMllNKRtEmfJH2//kqfPHnyyfMkzSfPVEiSJAAAAOD6\nlHIHAAAAgH1Q7AAAANwExQ4AAMBNUOwAAADcBMUOAADATVDsAAAA3ATFDgAAwE1Q7AAAANwE\nxQ4AAMBNUOwAAADcBMUOAADATVDsAAAA3ATFDgAAwE1Q7AAAANwExQ4AAMBNUOwAAADcBMUO\nAADATVDsAAAA3ATFDgAAwE1Q7AAAANwExQ4AAMBNUOwAAADcBMUOAADATVDsAAAA3ATFDgAA\nwE1Q7AAAANwExQ4AAMBNUOwAAADcBMUOAADATVDsAAAA3ATFDgAAwE1Q7AAAANwExQ4AAM