s\ncat(\"Sensitivity (True Positive Rate):\", sensitivity, \"\\n\")\ncat(\"Specificity (True Negative Rate):\", specificity, \"\\n\")\ncat(\"Accuracy:\", accuracy, \"\\n\")","metadata":{"execution":{"iopub.status.busy":"2024-02-17T23:32:01.689847Z","iopub.execute_input":"2024-02-17T23:32:01.691946Z","iopub.status.idle":"2024-02-17T23:32:01.836890Z"},"trusted":true},"execution_count":276,"outputs":[{"output_type":"display_data","data":{"text/plain":"          predictions\ntestLabels Negative Positive\n  Negative       56        9\n  Positive       17       46"},"metadata":{}},{"name":"stdout","text":"Sensitivity (True Positive Rate): 0.7301587 \nSpecificity (True Negative Rate): 0.8615385 \nAccuracy: 0.796875 \n","output_type":"stream"}]},{"cell_type":"code","source":"# Train the SVM model\nsvm_model <- svm(trainLabels ~ ., data = trainFeatures, kernel = \"radial\")\n\n# Make predictions on the test set\npredictions <- predict(svm_model, testFeatures)\n\n# Evaluate the model\nconf_matrix <- table(testLabels, predictions)\nconf_matrix\nTP <- conf_matrix[2, 2]  # True Positives\nTN <- conf_matrix[1, 1]  # True Negatives\nFP <- conf_matrix[1, 2]  # False Positives\nFN <- conf_matrix[2, 1]  # False Negatives\n\n# Calculate sensitivity, specificity, and accuracy\nsensitivity <- TP / (TP + FN)\nspecificity <- TN / (TN + FP)\naccuracy <- (TP + TN) / sum(conf_matrix)\n\n# Print the evaluation metrics\ncat(\"Sensitivity (True Positive Rate):\", sensitivity, \"\\n\")\ncat(\"Specificity (True Negative Rate):\", specificity, \"\\n\")\ncat(\"Accuracy:\", accuracy, \"\\n\")","metadata":{"execution":{"iopub.status.busy":"2024-02-17T23:13:38.267501Z","iopub.execute_input":"2024-02-17T23:13:38.269929Z","iopub.status.idle":"2024-02-17T23:13:38.385501Z"},"trusted":true},"execution_count":259,"outputs":[{"output_type":"display_data","data":{"text/plain":"          predictions\ntestLabels Negative Positive\n  Negative       57        8\n  Positive       13       50"},"metadata":{}},{"name":"stdout","text":"Sensitivity (True Positive Rate): 0.7936508 \nSpecificity (True Negative Rate): 0.8769231 \nAccuracy: 0.8359375 \n","output_type":"stream"}]},{"cell_type":"code","source":"# Train the SVM model\nsvm_model <- svm(trainLabels ~ ., data = trainFeatures, kernel = \"polynomial\")\n\n# Make predictions on the test set\npredictions <- predict(svm_model, testFeatures)\n\n# Evaluate the model\nconf_matrix <- table(testLabels, predictions)\nconf_matrix\nTP <- conf_matrix[2, 2]  # True Positives\nTN <- conf_matrix[1, 1]  # True Negatives\nFP <- conf_matrix[1, 2]  # False Positives\nFN <- conf_matrix[2, 1]  # False Negatives\n\n# Calculate sensitivity, specificity, and accuracy\nsensitivity <- TP / (TP + FN)\nspecificity <- TN / (TN + FP)\naccuracy <- (TP + TN) / sum(conf_matrix)\n\n# Print the evaluation metrics\ncat(\"Sensitivity (True Positive Rate):\", sensitivity, \"\\n\")\ncat(\"Specificity (True Negative Rate):\", specificity, \"\\n\")\ncat(\"Accuracy:\", accuracy, \"\\n\")","metadata":{"execution":{"iopub.status.busy":"2024-02-17T23:13:57.225394Z","iopub.execute_input":"2024-02-17T23:13:57.227299Z","iopub.status.idle":"2024-02-17T23:13:57.347330Z"},"trusted":true},"execution_count":260,"outputs":[{"output_type":"display_data","data":{"text/plain":"          predictions\ntestLabels Negative Positive\n  Negative       56        9\n  Positive       12       51"},"metadata":{}},{"name":"stdout","text":"Sensitivity (True Positive Rate): 0.8095238 \nSpecificity (True Negative Rate): 0.8615385 \nAccuracy: 0.8359375 \n","output_type":"stream"}]},{"cell_type":"code","source":"# Extract support vectors\nsupport_vectors <- trainFeatures[svm_model$index, ]\n\n# Plot the data points\nggplot(data = trainFeatures, aes(x = ST_depression, y = max_heart_rate, color = trainLabels)) +\n  geom_point() +\n  geom_point(data = support_vectors, color = \"black\", size = 3) +\n  geom_abline(intercept = as.numeric(svm_model$coefficients[1]), \n              slope = -as.numeric