[3]]\ncoef_values\n# Get the names of the features\nfeature_names <- colnames(trainFeatures)\n\n# Create a data frame with feature names and coefficients\nfeature_coefficients <- data.frame(feature = feature_names, coefficient = coef_values)\n\n# Sort the features by absolute coefficient value in descending order\nsorted_features <- feature_coefficients[order(abs(coef_values), decreasing = TRUE), ]\n\n# Print the top N most important features\ntop_n <- 10  # Change this value to see more or fewer features\nhead(sorted_features, top_n)","metadata":{"execution":{"iopub.status.busy":"2024-02-17T23:48:26.008881Z","iopub.execute_input":"2024-02-17T23:48:26.011016Z","iopub.status.idle":"2024-02-17T23:48:26.055213Z"},"trusted":true},"execution_count":291,"outputs":[{"output_type":"display_data","data":{"text/html":"-0.214356892167096","text/markdown":"-0.214356892167096","text/latex":"-0.214356892167096","text/plain":"[1] -0.2143569"},"metadata":{}},{"output_type":"display_data","data":{"text/html":"<table class=\"dataframe\">\n<caption>A data.frame: 1 × 2</caption>\n<thead>\n\t<tr><th></th><th scope=col>feature</th><th scope=col>coefficient</th></tr>\n\t<tr><th></th><th scope=col>&lt;fct&gt;</th><th scope=col>&lt;dbl&gt;</th></tr>\n</thead>\n<tbody>\n\t<tr><th scope=row>1</th><td>sex_male</td><td>-0.2143569</td></tr>\n</tbody>\n</table>\n","text/markdown":"\nA data.frame: 1 × 2\n\n| <!--/--> | feature &lt;fct&gt; | coefficient &lt;dbl&gt; |\n|---|---|---|\n| 1 | sex_male | -0.2143569 |\n\n","text/latex":"A data.frame: 1 × 2\n\\begin{tabular}{r|ll}\n  & feature & coefficient\\\\\n  & <fct> & <dbl>\\\\\n\\hline\n\t1 & sex\\_male & -0.2143569\\\\\n\\end{tabular}\n","text/plain":"  feature  coefficient\n1 sex_male -0.2143569 "},"metadata":{}}]},{"cell_type":"code","source":"# Extract support vectors\nsupport_vectors <- trainFeatures[svm_model$index, ]\n\n# Calculate the coefficients of the decision boundary line\ncoef <- coef(svm_model)[[1]]\nintercept <- coef[1]\nslope <- -c