abels for plotting\nplot_data <- cbind(trainFeatures, trainLabels)\n\n# Remove rows with missing values\nplot_data <- na.omit(plot_data)\n\n# Plot the data points and the decision boundary line\nggplot(data = plot_data, aes(x = ST_depression, y = max_heart_rate, color = factor(trainLabels))) +\n  geom_point() +\n  geom_point(data = support_vectors, color = \"black\", size = 1) +\n  geom_abline(intercept = intercept, slope = slope, color = \"blue\") +\n  theme_minimal()","metadata":{"execution":{"iopub.status.busy":"2024-02-17T23:33:21.606472Z","iopub.execute_input":"2024-02-17T23:33:21.608528Z","iopub.status.idle":"2024-02-17T23:33:22.175693Z"},"trusted":true},"execution_count":280,"outputs":[{"name":"stderr","text":"Warning message:\n“Removed 1 rows containing missing values (geom_abline).”\n","output_type":"stream"},{"output_type":"display_data","data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAAA0gAAANICAIAAAByhViMAAAABmJLR0QA/wD/AP+gvaeTAAAg\nAElEQVR4nOzdd3wUZf4H8O8zM7ubZFM2vTdIIbTQu0hTQAUrKvbeu556p97pz7tTz/POcurp\nnV08CzaKICBN6RB6SQghJCG9l60z8/z+CIRssgsEkp3s8nn/4cs8k2fnO7uBfHhmnudhnHMC\nAAAAAO8naF0AAAAAAHQPBDsAAAAAH4FgBwAAAOAjEOwAAAAAfASCHQAAAICPQLADAAAA8BEI\ndgAAAAA+AsEOAAAAwEdIWhfQS3HO6+vrichoNOr1eq3LOXMNDQ3+/v7efgmqqvr7+/v5+Wld\ny5lrbm6WJMmrL6GpqUmWZb1ebzQata7lzJnNZs65t1+CzWYTRTE4OFjrWs6czWaz2Wzefglm\ns5mIQkNDta4F4AQEO7cURSEib9+ZQ1VVrUs4W4qiqKrq7RfiA5fAOW/9LLQu5Kxwzn3gEhRF\nYYxpXchZwQcB0ENwKxYAAADARyDYAQAAAPgIBDsAAAAAH4FgBwAAAOAjEOwAAAAAfASCHQAA\nAICPQLADAAAA8BEIdgAAAAA+AsEOAAAAwEcg2AEAAAD4CAQ7AAAAAB+BYAcAAADgIxDsAAAA\nAHwEgh0AAACAj0CwAwAAAPARCHYAAAAAPgLBDgAAAMBHINgBAAAA+AgEOwAAAAAfgWAHAAAA\n4CMQ7AAAAAB8BIIdAAAAgI9AsAMAAADwEQh2AAAAAD4CwQ4AAADARyDYAQAAAPgIBDsAAAAA\nH4FgBwAAAOAjJA+f771brzG+8tENUQEuj2766q2v1mwvaRIz+w+78YE7MoJ0J2/vQZwLDfVk\nt1OA61IBAAAAehsPBjtu3/nLB4trLFe7OZ7/1XN//bLgxvsfyAqVF7/39h8fs8x7/zGRuW3v\nOcq2zcpPPxqbm4iIRFGeMFmaNp30hh48JQAAAMBZ81CwK//t1UdfX9diV91+B7e/+s2evte/\ndtW0PkSU9jdhzk2vfHL0rtvi9a7bEwJ7qFRl5TL550XEjidHVVHWrOBFh3V3P3SiEQAAAKD3\n8dAzdhFDb