ht":420}}}]},{"cell_type":"code","source":"support_vectors <- predictions[svm_model$index, ]\n\n# Plot the data points\nlibrary(ggplot2)\nggplot(data = predictions, aes(x = feature1, y = feature2, color = testLabels)) +\n  geom_point() +\n  geom_point(data = support_vectors, color = \"black\", size = 3) +\n  geom_abline(intercept = -svm_model$rho / svm_model$coef[1,2], slope = -svm_model$coef[1,1] / svm_model$coef[1,2], color = \"blue\") +\n  theme_minimal()","metadata":{"execution":{"iopub.status.busy":"2024-02-17T23:22:40.431731Z","iopub.execute_input":"2024-02-17T23:22:40.433845Z","iopub.status.idle":"2024-02-17T23:22:40.456938Z"},"trusted":true},"execution_count":266,"outputs":[{"ename":"ERROR","evalue":"Error in `[.default`(predictions, svm_model$index, ): incorrect number of dimensions\n","traceback":["Error in `[.default`(predictions, svm_model$index, ): incorrect number of dimensions\nTraceback:\n","1. predictions[svm_model$index, ]","2. `[.factor`(predictions, svm_model$index, )","3. NextMethod(\"[\")"],"output_type":"error"}]},{"cell_type":"code","source":"svm_model <- svm(trainLabels ~ ., data = trainFeatures, kernel = \"polynomial\")\nplot(svm_model, trainFeatures)","metadata":{"execution":{"iopub.status.busy":"2024-02-17T23:19:05.738016Z","iopub.execute_input":"2024-02-17T23:19:05.740020Z","iopub.status.idle":"2024-02-17T23:19:05.817090Z"},"trusted":true},"execution_count":264,"outputs":[{"ename":"ERROR","evalue":"Error in plot.svm(svm_model, trainFeatures): missing formula.\n","traceback":["Error in plot.svm(svm_model, trainFeatures): missing formula.\nTraceback:\n","1. plot(svm_model, trainFeatures)","2. plot(svm_model, trainFeatures)","3. plot.svm(svm_model, trainFeatures)","4. stop(\"missing formula.\")"],"output_type":"error"}]},{"cell_type":"markdown","source":"*** . Now choose one classifier to further optimize.\n1. Why did you choose this classifier over the other?\n2. Explain how this classifier works from a theoretical point of view – try to include as\nmuch detail as possible.\n3. Try to optimize the classifier to achieve a higher accuracy (no matter how small) than\nfirst found. Remember that we have a particular focus on predicting those that\ndevelop heart disease.\na. Were there any features that could be removed? Please print the output that\nhelped you make this decision.\nb. Did changing the way data is sampled during training/testing affect the\naccuracy?\nc. What about some of the internal parameters specific to the classifier? Please\nexplain how one of these parameters can affect accuracy","metadata":{}},{"cell_type":"code","source":"set.seed(1) # for repoducibility\ntrainIndex = caret::createDataPartition(dataset$class, list=FALSE,\n                                        p=0.2) # 10% of data for training\n# Training data\ntr_dataset = dataset[trainIndex, \n                     2:dim(dataset)[2]]  # Leave behind the patient id, we don't need it\n# Testing data\nts_dataset = dataset[-trainIndex, \n                     2:dim(dataset)[2]]  # Leave behind the patient id, we don't need it\n\nX_tr = tr_dataset[, 1:ncol(tr_dataset) - 1] # Remove the last column, which is the labels (not a factor)\nY_tr = tr_dataset[, ncol(tr_dataset)]\nX_ts = ts_dataset[, 1:ncol(ts_dataset) - 1] # Remove the last column, which is the labels (not a factor)\nY_ts = ts_dataset[, ncol(ts_dataset)]\n\n# Some formatting\nX_tr = as.matrix(X_tr) # I need the data to be of class matrix\nX_ts = as.matrix(X_ts)\n# We need labels to be 0 for benign and 1 for malignant\nY_tr = Y_tr == '1'  # TRUE or FALSE\nY_tr = as.numeric(Y_tr)  # 1 or 0\nY_ts = Y_ts == '1'  # TRUE or FALSE\nY_ts = as.numeric(Y_ts)  # 1 or 0\n\n# ANN model\n# ==================================================================\n\n# Compute the sigmoid function of x\n# This will be my activation function\nsigmoid <- function(x){\n  return (1.0 / (1.0 + exp(-x)))\n}\n\n# Compute the derivative of the sigmoig function with value x\n# I need this for back-propagation\nsigmoid_derivative <- function(x){\n  return (x * (1.0 - x))\n}\n\n# Initialize an ANN model\n#\n# In this example, the model has 1 hidden layer with n_H neurons, and an output later with 1 (n_O) neurons\n#\n# lr = Learning rate\n# n_F = Number of factors\n# n_H = Number of neurons in the hidden layer\ninit_ann <- function(lr, n_F, n_H){\n  n_O = 1  # Number of output neurons\n  model = list(\n    # Normalization\n    # -------------\n    \"mean_F\" = vector(length=n_F),  # Mean of factors\n    \"sd_F\" = vector(length=n_F),  # Std of factors\n    # Constants\n    # ---------\n    \"lr\"= lr,  # Just save the learning rate\n    # Parameters\n    # ----------\n    # Create a matrix with the weights of the hidden layer. These weights are applied to the input data.\n    # We add one more weight for each neuron (i.e. n_F + 1): the bias term\n    \"Wh\" = matrix(rnorm((n_F + 1)*n_H), nrow=n_F + 1, ncol=n_H),  # dim(Wh) == c(n_F, n_H)\n    # Create a matrix with the weights of the output layer. These weights are applied to the output of the hidden layer.\n    # We add one more weight for each neuron (i.e. n_H + 1): the bias term\n    \"Wo\" = matrix(rnorm((n_H + 1)*n_O), nrow=(n_H + 1), ncol=n_O)  # dim(Wo) == c(n_H, n_O)  \n  )\n  return(model)\n}\n\n# Train an ANN\n#\n# This is done in 2 steps:\n#\n# Step 1: Forward pass\n# + Input data flows forwards through the network. At the end, we have the model's output for the presented data.\n#\n# Step 2: Backward pass\n# + The error flows backwards through the network. At the end, we have how each weight affects the model's error.\n# \n# X - n_Sxn_F matrix containing the training data, where n_S is the number of samples and n_F the number of factors\n# Y - n_Sx1 vector containing the training labels\n# n_iters - Number of times the network goes through the data\ntrain_ann <- function(ann_model, X, Y, n_iters = 1){\n  \n  # Calculate normalization parameters and normalize\n  for (f in 1:ncol(X)){  # Go through each factor one by one\n    ann_model$mean_F[f] = mean(X[, f])\n    ann_model$sd_F[f] = sd(X[, f])\n    X[, f] = X[, f] - ann_model$mean_F[f]\n    X[, f] = X[, f]/ann_model$sd_F[f]\n  }  # At this point, you can check the mean and std of a factor is 1 and 0 respectively: mean(X[, 2]) AND sd(X[, 1])\n  \n  # Prepare constants with dimension information. This is not really needed, but it'll help understanding\n  n_S = nrow(X)  # Number of samples\n  n_F = ncol(X)  # Number of input factors\n  n_H = ncol(ann_model$Wh)  # Number of hidden neurons\n  n_O = ncol(ann_model$Wo)  # Number of output neurons\n  \n  # We are going to save the error/loss on each iteration, so that we can plot it at the end\n  loss = vector(\"numeric\", length = n_iters)\n  \n  # Loop going through all iterations\n  for (it in 1:n_iters){ # it = 1\n    \n    # Step 1: Forward pass\n    # ===================================================\n    \n    # Hidden layer:\n    #\n    # Input of hidden layer = Data\n    Xb = cbind(X, rep(1, nrow(X))) # Append 1s for the bias term\n    # Zh = Inputs to neurons of the hidden layer, before the activation function\n    Zh = Xb %*% ann_model$Wh  # dim(Zh) == c(n_S, n_H)\n    # Yh = Output of the hidden layer, after the activation function\n    Yh = sigmoid(Zh)  # dim(Yh) == dim(Zh)\n    \n    # Output layer\n    #\n    # Inputs to output layer = Output of hidden layer\n    Yhb = cbind(Yh, rep(1, nrow(Yh)))  # Append 1s for the bias\n    # Zo = Inputs to neurons of the output layer, before the activation function\n    Zo = Yhb %*% ann_model$Wo  # dim(Zo) == c(n_S, n_O)\n    # Yo = Output of the output layer, after the activation function\n    Yo = sigmoid(Zo)  # dim(Yo) == dim(Zo)\n    \n    # Step 2: Backward pass\n    # ===================================================\n    \n    # Error = Mean Square Error (there are others)\n    loss[it] = mean((Y - Yo)^2)\n    print(paste(\"Iteration\", it, \"error:\", loss[it]))\n    \n    # We need derivatives for each point in the network\n    dE_dYo = 2*(Yo - Y)  # dim(dE_dYo) == c(n_S, n_O)\n    dYo_dZo = sigmoid_derivative(Yo)  # dim(dYo_dZo) == c(n_S, n_O)\n    dZo_dWo = Yhb  # dim(dZo_dWo) == dim(Yh) == c(n_S, n_H + 1)\n    dZo_dYhb = ann_model$Wo  # dim(dZo_dYh) == dim(ann_model$Wo) == c(n_H + 1, n_O)\n    dYh_dZh = sigmoid_derivative(Yh)  # dim(dYh_dZh) == dim(Zh) == c(n_S, n_H)\n    dZh_dWh = Xb  # dim(dZh_dWh) == dim(X) == c(n_S, n_F)\n    \n    # Now we can move the derivative of the error backwards through the network. We need dE_dWo and dE_dWh\n    dE_dZo = dE_dYo * dYo_dZo    # dim(dE_dZo) == c(n_S, n_O)\n    dE_dWo = t(dZo_dWo) %*% dE_dZo  # dim(dE_dWo) == dim(ann_model$Wo)\n    dE_dYhb = dE_dZo %*% t(dZo_dYhb)  # dim(dE_dYhb) == c(n_S, n_H + 1)\n    # Next, we drop the bias term. Why? Because the bias input is a constant (b = 1) and it's a dead end.\n    dE_dYh = dE_dYhb[, 1:n_H]  # dim(dE_dYh) == c(n_S, n_H)  \n    dE_dZh = dE_dYh * dYh_dZh  # dim(dE_dZh) == c(n_S, n_H)  \n    dE_dWh = t(dZh_dWh) %*% dE_dZh  # dim(dE_dWh) == dim(ann_model$Wh)\n    \n    # Update weights in the direction of the derivatives\n    # Mean error\n    dE_dWo = dE_dWo/n_S\n    dE_dWh = dE_dWh/n_S\n    # We change weights by a proportion of dE. This proportion is controled by the learning rate\n    ann_model$Wo = ann_model$Wo - (ann_model$lr*dE_dWo)\n    ann_model$Wh = ann_model$Wh - (ann_model$lr*dE_dWh)\n    \n  } \n  plot(loss)\n  \n  return(ann_model)\n}\n\n# Test an ANN\n#\n# This is litterally copy and paste from the \"Forward pass\" section in the fuction above\n#\n# model - Output of \"train_ann\" above\n# X - n_Sxn_F matrix containing the testing data, where n_S is the number of samples and n_F the number of factors\ntest_ann <- function(ann_model, X){\n  \n  # Normalize\n  for (f in 1:ncol(X)){  # Go through each factor one by one\n    X[, f] = X[, f] - ann_model$mean_F[f]\n    X[, f] = X[, f]/ann_model$sd_F[f]\n  }  # At this point, you can check the mean and std of a factor is 1 and 0 respectively: mean(X[, 2]) AND sd(X[, 1])\n  \n  \n  # Forward pass\n  # ===================================================\n  \n  # Hidden layer:\n  #\n  # Input of hidden layer = Data\n  Xb = cbind(X, rep(1, nrow(X))) # Append 1s for the bias term\n  # Zh = Inputs to neurons of the hidden layer, before the activation function\n  Zh = Xb %*% ann_model$Wh  # dim(Zh) == c(n_S, n_H)\n  # Yh = Output of the hidden layer, after the activation function\n  Yh = sigmoid(Zh)  # dim(Yh) == dim(Zh)\n  \n  # Output layer\n  #\n  # Inputs to output layer = Output of hidden layer\n  Yhb = cbind(Yh, rep(1, nrow(Yh)))  # Append 1s for the bias\n  # Zo = Inputs to neurons of the output layer, before the activation function\n  Zo = Yhb %*% ann_model$Wo  # dim(Zo) == c(n_S, n_O)\n  # Yo = Output of the output layer, after the activation function\n  Yo = sigmoid(Zo)  # dim(Yo) == dim(Zo)\n  \n  return(Yo)\n}\n\n# Train model\n# ==================================================================\n\nmodel_1nn = init_ann(lr = 0.01, n_F = ncol(X_tr), n_H = 3)  \n# Shape of the weight matrix for the hidden layer = dim(model_1nn$Wh)\n# Shape of the weight matrix for the output layer = dim(model_1nn$Wo)\n\n# Train a 1-NN using euclidean distance. Note that the last column of tr_dataset contains the labels\nmodel_1nn = train_ann(ann_model = model_1nn, X = X_tr, Y = Y_tr,\n                      n_iter=5000)  # We will go through the data 4k times\n\n\n# Test model\n# ==================================================================\n\n# Test the model\nts_res = test_ann(model_1nn, X = X_ts)\n\n# We need to apply a threshold to the output of the ANN (e.g. 0.5)\nts_res = as.numeric(ts_res>0.5)\n\n# Compare predicted and real labels. Success = #Correct / #Total\nsuccess_rate = sum(ts_res == Y_ts)/length(Y_ts)\nprint(paste('The success rate is', success_rate))","metadata":{"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"code","source":"source(\"../input/ann-pm402/models/annModel.R\")\ndataset = read.csv(\"../input/pmim402-assignment-datasets/heart_disease_modified.csv\")\ndataset = subset(dataset, select = -c(X,drug,pace_maker,fam_hist),na.rm = T)\ndataset$class <- as.factor(dataset$class)\n# dataset$smoker <-  as.factor(dataset$smoker)\nset.seed(1)\ntrainIndex = caret::createDataPartition(dataset$class, list=FALSE,\n                                        p=0.2) # 20% of data for training\n# Training data\ntr_dataset = dataset[trainIndex, \n                     2:dim(dataset)[2]]  # Leave behind the patient id, we don't need it\n# Testing data\nts_dataset = dataset[-trainIndex, \n                     2:dim(dataset)[2]] \n\nann_fit = caret::train(class ~ ., data = tr_dataset,\n                       method = annModel,\n                       tuneGrid = data.frame(hidden = c(\"c(5)\", \"c(5, 5)\", \"c(5, 5, 5)\")),\n                       preProcess = c(\"scale\", \"center\"),\n                       lifesign='minimal')\n# Plot results\nann_fit\n# Predict\ntest_pred = predict(ann_fit, newdata = ts_dataset)\n# Confusion matrix\nconfusionMatrix(test_pred, ts_dataset$class)\n# Plot neural network\nplot(ann_fit$finalModel$ann)\n","metadata":{"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"markdown","source":"*** **How accurately can the classifier predict those that develop heart disease?\nWhat is in the output that signifies this?\nb. How many people are misclassified as developing heart disease? Where is\nthis answer found in the output?","metadata":{}},{"cell_type":"code","source":"\nheart_table <- table(predicted = test_pred,observed = ts_dataset$class)\nAccuracy <-(heart_table[[1]]+ heart_table [[4]])/(heart_table[[1]]+heart_table[[2]]+heart_table[[3]]+heart_table[[4]])*100\nAccuracy","metadata":{"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"code","source":"head(dataset)","metadata":{"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"code","source":"roc_data = data.frame(Class = ts_dataset$class, ann = predict(ann_fit, ts_dataset, type=\"prob\"))\n# head(roc_data)\nann_roc = pROC::roc(response = roc_data$Class,\n                    predictor = roc_data$ann.0,\n                    levels = ann_fit$levels[1:2])\npROC::plot.roc(ann_roc)\n\n# Add ROC from knn\npROC::plot.roc(ann_roc, col = \"green\", add = TRUE)","metadata":{"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"code","source":"dataset = read.csv(\"../input/pmim402-assignment-datasets/heart_disease_modified.csv\")\ndataset = subset(dataset, select = -c(X,drug,pace_maker,fam_hist,Patient_ID),na.rm = T)\nnrow(dataset)\nbound <- floor((nrow(dataset)/4)*3)   # 75-25% training testing split\n\ndataset <- dataset[sample(nrow(dataset)),]          # shuffles the data \ndataset.train <- dataset[1:bound, ]              # get training set\ndataset.test <- dataset[(bound+1):nrow(dataset), ]    # get test set","metadata":{"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"code","source":"\nnb.mdl <- naiveBayes(class ~ ., data = dataset.train)\n\n#Output apriori and conditional probabilities\nnb.mdl\n","metadata":{"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"code","source":"# classify unseen data\nnb.pd<-predict(nb.mdl, dataset.test)\nnb.pd\n# length(nb.pd)\n# dataset.test$class      # ground truth\n# table(predicted = nb.pd,observed = dataset.test$class)","metadata":{"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"code","source":"length(nb.pd)","metadata":{"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"code","source":"dataset.test$class      # ground truth\nheart0_table<- table(predicted = nb.pd,observed = dataset.test$class)","metadata":{"trusted":true},"execution_count":null,"outputs":[]},{"cell_type":"code","source":"\nheart0_table <- table(predicted = nb.pd,observed = dataset.test$class)\nAccuracy0<-(heart0_table[[1]]+heart0_table[[4]])/\n(heart0_table[[1]]+heart0_table[[2]]+heart0_table[[3]]+heart0_table[